        cursorIndexBypos: function(cx, cy){
            var x = 0;
            var y = 0;
            var index = 0;
            for (var i = 0; i< this.content_value_t0.length; i++){
                index = i;
                var c = this.content_value_t0[i];
                if (cx == x && cy == y){
                    break;
                }
                x = x +1;
                if (c == "\n"){
                    x = 0;
                    y = y +1;
                }
            }
            return index;
        },

